export default function RsiWidget() {
    // Declare a new state variable, which we'll call "count"
    const [count, setCount] = useState(0);

    return (


        <div className="flex flex-row ">
            <div className="px-1 rounded-md border-2 border-red-500 text-sm font-medium text-white bg-gray-900 hover:bg-red-800 hover:text-green-900 focus:outline-none focus:text-white focus:bg-gray-700 ">

                <div className="flex flex-row">
                    <div>
                        <svg height="30" width="100">
                            <g fill="none" stroke="green" stroke-width="6">
                                <path stroke-linecap="round" d="M 5 5 l 25 0" />
                            </g>
                        </svg>
                    </div>



                </div>
            </div>


        </div>






    );
}
